import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <TextField> sdasd </TextField>
        <TextField> </TextField>
        <Button> sent </Button>
      </div>
    );
  }
}

export default App;
